import React, {useState, useEffect} from "react";
import { useHistory, useParams } from "react-router";
import { NavLink } from "react-router-dom";
import "./Select.css"


const Select = (data) => {
    useEffect(() => console.log(data.data),[]);

    return(
    <div className="selectors">
       
        
            {data.data.map((standings) => {
                return standings.type === "TOTAL"?
                <select class="minimal">
                    {standings.table.map((e) => {
                        return(
                            <option><img className="teamLogo" src={e.team.crestUrl}></img> {e.position}, {e.team.name} key={e.position}</option> 
                        );
                    })}
                
                </select>
                :null;
            })}
        
        {/* <select class="minimal">
            {data.data.table.map((standings) => {
                <option>{standings.position}, {standings.team.name} key={standings.id}</option>
            })}
        </select> */}
    </div>
    );

}
export default Select;
